import React from "react";
import Phone from "../assets/phone pic.png"

const Analytics =() => { 
  return (   
<div className="w-full bg-[#FBEDEC] py-16 px-4 ">
    <div className="max-w-[1240px] mx-auto grid md:grid-cols-2">
          < img src={Phone} alt="/" />
    </div>
 
</div>
  )
}

export default Analytics
